import React from 'react';
import './App.css';
import {useSelector} from 'react-redux';

function App() {

  const counter = useSelector(state => state.counter);

  return (
    <div>
      <h1>Counter {counter}</h1>
      Hola Mundo 
    </div>
  );
}

export default App;
